import React from 'react';
import {Box, Button, Center, Heading, VStack} from "@chakra-ui/react";
import {useParams} from "react-router-dom";

const GradeQuiz = () => {

    //get id in params
    const {id} = useParams();

    return (
        <Box w={'100%'} >
                <Box bg={'red'} h={'100vh'}>
                    <VStack>
                        <Button minW={300}>Start</Button>
                    </VStack>
                </Box>
        </Box>
    );
};

export default GradeQuiz;
